class Solution {
    public double poly(List<Double> xs, double x) {
        double result = 0;
        for (int i = 0; i < xs.size(); i++) {
            result += xs.get(i) * Math.pow(x, i);
        }
        return result;
    }

    public double find_zero(List<Double> xs) {
        double left = -1000; // Start with a reasonable range
        double right = 1000;
        double mid = 0;
        double epsilon = 1e-7; // Precision for finding the root

        while (right - left > epsilon) {
            mid = (left + right) / 2;
            if (poly(xs, mid) > 0) {
                right = mid; // Move left
            } else {
                left = mid; // Move right
            }
        }

        return mid; // Return the midpoint as the root
    }
}

