class Solution {
    public int modp(int n, int p) {
        if (p == 1) return 0; // Since any number mod 1 is 0
        long result = 1;
        long base = 2;
        n = n % (p - 1); // Using Fermat's Little Theorem for optimization
        while (n > 0) {
            if ((n & 1) == 1) {
                result = (result * base) % p;
            }
            base = (base * base) % p;
            n >>= 1; // Divide n by 2
        }
        return (int) result;
    }
}

