                    c = Character.toUpperCase(c);
                } else {
                    c = Character.toLowerCase(c);
                }

                // Replace vowels
                switch (Character.toLowerCase(c)) {
                    case 'a':
                        c = 'c'; // 'a' -> 'c'
                        break;
                    case 'e':
                        c = 'g'; // 'e' -> 'g'
                        break;
                    case 'i':
                        c = 'k'; // 'i' -> 'k'
