        int numeratorN = Integer.parseInt(nParts[0]);
        int denominatorN = Integer.parseInt(nParts[1]);

        // Calculate the product of the fractions
        long productNumerator = (long) numeratorX * numeratorN;
        long productDenominator = (long) denominatorX * denominatorN;

        // Check if the product is a whole number
        return productNumerator % productDenominator == 0;
    }
}

