            if (string.charAt(i) != string.charAt(j)) {
                return false;
            }
            i++;
            j--;
        }
        return true;
    }

    public String make_palindrome(String string) {
        int n = string.length();
        for (int i = n; i >= 0; i--) {
            if (isPalindrome(string.substring(i))) {
                String prefix = string.substring(0, i);
                StringBuilder sb = new StringBuilder(prefix);
                return string + sb.reverse().toString();
            }
        }
        return string; // In case the string is empty or no palindrome found
    }
}

