class Solution {
    public List<Integer> sort_third(List<Integer> l) {
        List<Integer> result = new ArrayList<>(l);
        List<Integer> thirdIndicesValues = new ArrayList<>();

        // Collect values at indices divisible by 3
        for (int i = 0; i < l.size(); i++) {
            if (i % 3 == 0) {
                thirdIndicesValues.add(l.get(i));
            }
        }

        // Sort the collected values
        Collections.sort(thirdIndicesValues);

        // Replace values at indices divisible by 3 with sorted values
        int sortedIndex = 0;
        for (int i = 0; i < result.size(); i++) {
            if (i % 3 == 0) {
                result.set(i, thirdIndicesValues.get(sortedIndex));
                sortedIndex++;
            }
        }

        return result;
    }
}

