class Solution {
    public boolean correct_bracketing(String brackets) {
        int balance = 0;
        for (char ch : brackets.toCharArray()) {
            if (ch == '<') {
                balance++;
            } else if (ch == '>') {
                balance--;
            }
            // If balance goes negative, it means there's a closing bracket without a matching opening bracket
            if (balance < 0) {
                return false;
            }
        }
        // At the end, balance should be zero for all brackets to be matched
        return balance == 0;
    }
}

