class Solution {
    public String circular_shift(int x, int shift) {
        String str = Integer.toString(x);
        int len = str.length();

        // If shift is greater than the number of digits, reverse the string
        if (shift >= len) {
            return new StringBuilder(str).reverse().toString();
        }

        // Perform the circular shift
        String shifted = str.substring(len - shift) + str.substring(0, len - shift);
        return shifted;
    }
}

