        for (int i = word.length() - 1; i >= 1; i--) {
            char currentChar = word.charAt(i);
            if (vowels.indexOf(currentChar) != -1) {
                lastVowelIndex = i;
            } else if (Character.isLetter(currentChar) && lastVowelIndex != -1) {
                // We found a consonant after a vowel
                if (i > 0 && vowels.indexOf(word.charAt(i - 1)) != -1) {
                    return String.valueOf(word.charAt(lastVowelIndex));
