class Solution {
    public List<Integer> tri(int n) {
        List<Integer> tribonacci = new ArrayList<>();
        for (int i = 0; i <= n; i++) {
            tribonacci.add(calculateTri(i));
        }
        return tribonacci;
    }

    private int calculateTri(int n) {
        if (n == 0) return 1;
        if (n == 1) return 3;
        if (n % 2 == 0) {
            return 1 + n / 2;
        } else {
            return calculateTri(n - 1) + calculateTri(n - 2) + calculateTri(n + 1);
        }
    }
}

