class Solution {
    public Optional<Object> compare_one(Object a, Object b) {
        // Convert both inputs to Double for comparison
        Double valueA = convertToDouble(a);
        Double valueB = convertToDouble(b);

        // Check if values are equal
        if (valueA.equals(valueB)) {
            return Optional.empty();
        }

        // Return the larger value in its original type
        if (valueA > valueB) {
            return Optional.of(a);
        } else {
            return Optional.of(b);
        }
    }

    private Double convertToDouble(Object obj) {
        if (obj instanceof String) {
            String str = (String) obj;
            // Replace comma with dot for proper parsing
            str = str.replace(',', '.');
            return Double.parseDouble(str);
        } else if (obj instanceof Number) {
            return ((Number) obj).doubleValue();
        }
        throw new IllegalArgumentException("Unsupported type");
    }
}

