class Solution {
    public List<Integer> order_by_points(List<Integer> nums) {
        Collections.sort(nums, new Comparator<Integer>() {
            @Override
            public int compare(Integer a, Integer b) {
                int sumA = digitSum(a);
                int sumB = digitSum(b);
                if (sumA != sumB) {
                    return Integer.compare(sumA, sumB);
                } else {
                    return Integer.compare(nums.indexOf(a), nums.indexOf(b));
                }
            }

            private int digitSum(int num) {
                int sum = 0;
                while (num != 0) {
                    sum += Math.abs(num % 10);
                    num /= 10;
                }
                return sum;
            }
        });
        return nums;
    }
}

