        for (String group : groups) {
            int maxDepth = 0;
            int currentDepth = 0;

            for (char ch : group.toCharArray()) {
                if (ch == '(') {
                    currentDepth++;
                    maxDepth = Math.max(maxDepth, currentDepth);
                } else if (ch == ')') {
                    currentDepth--;
                }
            }
            result.add(maxDepth);
        }

        return result;
    }
}

