class Solution {
    public double poly(List<Double> xs, double x) {
        double result = 0;
        for (int i = 0; i < xs.size(); i++) {
            result += xs.get(i) * Math.pow(x, i);
        }
        return result;
    }

    public double find_zero(List<Double> xs) {
        double low = -1000; // Starting lower bound for search
        double high = 1000; // Starting upper bound for search
        double mid;

        // Use binary search to find a root
        while (high - low > 1e-7) { // Precision threshold
            mid = (low + high) / 2;
            if (poly(xs, mid) > 0) {
                high = mid; // Move high down if poly(mid) is positive
            } else {
                low = mid; // Move low up if poly(mid) is negative
            }
        }

        return (low + high) / 2; // Return the midpoint as the root
    }
}

