class Solution {
    public int starts_one_ends(int n) {
        if (n == 1) {
            return 2; // The numbers are 1 and 1
        }

        // Count of n-digit numbers that start with 1
        int startWithOne = (int) Math.pow(10, n - 1);

        // Count of n-digit numbers that end with 1
        int endWithOne = (int) Math.pow(10, n - 1);

        // Count of n-digit numbers that both start and end with 1
        int bothStartAndEndWithOne = (int) Math.pow(10, n - 2);

        // Total count is the sum of both cases minus the overlap
        return startWithOne + endWithOne - bothStartAndEndWithOne;
    }
}

