class Solution {
    public List<Integer> minPath(List<List<Integer>> grid, int k) {
        int n = grid.size();
        List<Integer> result = new ArrayList<>();
        boolean[][] visited = new boolean[n][n];
        PriorityQueue<Path> pq = new PriorityQueue<>((a, b) -> {
            for (int i = 0; i < k; i++) {
                if (i >= a.values.size() || i >= b.values.size()) {
                    return a.values.size() - b.values.size();
                }
                if (!a.values.get(i).equals(b.values.get(i))) {
                    return a.values.get(i) - b.values.get(i);
                }
            }
            return 0;
        });

        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                pq.offer(new Path(i, j, Arrays.asList(grid.get(i).get(j))));
            }
        }

        while (!pq.isEmpty()) {
            Path current = pq.poll();
            if (current.values.size() == k) {
                result = current.values;
                break;
            }

            int x = current.x;
            int y = current.y;

            for (int[] dir : new int[][]{{0, 1}, {1, 0}, {0, -1}, {-1, 0}}) {
                int newX = x + dir[0];
                int newY = y + dir[1];

                if (newX >= 0 && newX < n && newY >= 0 && newY < n) {
                    List<Integer> newPath = new ArrayList<>(current.values);
                    newPath.add(grid.get(newX).get(newY));
                    pq.offer(new Path(newX, newY, newPath));
                }
            }
        }

        return result;
    }

    private static class Path {
        int x, y;
        List<Integer> values;

        Path(int x, int y, List<Integer> values) {
            this.x = x;
            this.y = y;
            this.values = values;
        }
    }
}

