        // Check if the list is a palindrome
        for (int i = 0; i < n / 2; i++) {
            if (!q.get(i).equals(q.get(n - 1 - i))) {
                isBalanced = false;
                break;
            }
        }

        // Calculate the sum of elements
        for (int num : q) {
            sum += num;
        }

        // Return true if it's balanced and the sum is less than or equal to w
        return isBalanced && sum <= w;
    }
}

