class Solution {
    public int starts_one_ends(int n) {
        if (n == 1) {
            return 2; // The numbers are 1 and 1
        }

        // Count of n-digit numbers starting with 1
        int startWithOne = (int) Math.pow(10, n - 1);

        // Count of n-digit numbers ending with 1
        int endWithOne = (int) Math.pow(10, n - 1);

        // Count of n-digit numbers starting and ending with 1
        int startAndEndWithOne = (int) Math.pow(10, n - 2);

        // Total count is the sum of both counts minus the overlap
        return startWithOne + endWithOne - startAndEndWithOne;
    }
}

