class Solution {
    public int closest_integer(String value) {
        double number = Double.parseDouble(value);
        int floor = (int) Math.floor(number);
        int ceil = (int) Math.ceil(number);

        if (Math.abs(number - floor) < Math.abs(number - ceil)) {
            return floor;
        } else if (Math.abs(number - floor) > Math.abs(number - ceil)) {
            return ceil;
        } else {
            // If equidistant, round away from zero
            return (number > 0) ? ceil : floor;
        }
    }
}

