class Solution {
    public int minSubArraySum(List<Integer> nums) {
        int minSum = Integer.MAX_VALUE;
        int currentSum = 0;

        for (int num : nums) {
            currentSum += num;
            if (currentSum < minSum) {
                minSum = currentSum;
            }
            if (currentSum > 0) {
                currentSum = 0; // Reset current sum if it becomes positive
            }
        }
        return minSum;
    }
}

