class Solution {
    public int max_fill(List<List<Integer>> grid, int capacity) {
        int totalLowerings = 0;

        for (List<Integer> row : grid) {
            int waterUnits = 0;
            for (Integer cell : row) {
                waterUnits += cell; // Count the number of water units in the well
            }
            // Calculate the number of times we need to lower the bucket for this well
            totalLowerings += (int) Math.ceil((double) waterUnits / capacity);
        }

        return totalLowerings;
    }
}

