class Solution {
    public List<String> select_words(String s, int n) {
        List<String> result = new ArrayList<>();
        if (s.isEmpty()) {
            return result;
        }

        String[] words = s.split(" ");
        for (String word : words) {
            int consonantCount = countConsonants(word);
            if (consonantCount == n) {
                result.add(word);
            }
        }
        return result;
    }

    private int countConsonants(String word) {
        int count = 0;
        for (char c : word.toCharArray()) {
            if (isConsonant(c)) {
                count++;
            }
        }
        return count;
    }

    private boolean isConsonant(char c) {
        c = Character.toLowerCase(c);
        return c >= 'a' && c <= 'z' && "aeiou".indexOf(c) == -1;
    }
}

