class Solution {
    public String get_closest_vowel(String word) {
        String vowels = "aeiouAEIOU";
        int lastVowelIndex = -1;
        String closestVowel = "";

        for (int i = word.length() - 1; i > 0; i--) {
            char currentChar = word.charAt(i);
            if (vowels.indexOf(currentChar) != -1) {
                lastVowelIndex = i;
            } else if (Character.isLetter(currentChar) && lastVowelIndex != -1) {
                if (i > 0 && vowels.indexOf(word.charAt(i - 1)) != -1) {
                    closestVowel = String.valueOf(currentChar);
                    break;
                }
            }
        }

        if (lastVowelIndex != -1 && closestVowel.isEmpty()) {
            closestVowel = String.valueOf(word.charAt(lastVowelIndex));
        }

        return closestVowel;
    }
}

