class Solution {
    public String match_parens(List<String> lst) {
        String s1 = lst.get(0);
        String s2 = lst.get(1);

        // Check both concatenation orders
        if (isGood(s1 + s2) || isGood(s2 + s1)) {
            return "Yes";
        }
        return "No";
    }

    private boolean isGood(String s) {
        int balance = 0;
        for (char c : s.toCharArray()) {
            if (c == '(') {
                balance++;
            } else {
                balance--;
            }
            if (balance < 0) {
                return false; // More closing than opening
            }
        }
        return balance == 0; // Must be balanced at the end
    }
}

