class Solution {
    public List<Integer> maximum(List<Integer> arr, int k) {
        // Create a max heap to store the k largest elements
        PriorityQueue<Integer> maxHeap = new PriorityQueue<>(Collections.reverseOrder());

        // Add all elements to the max heap
        for (int num : arr) {
            maxHeap.offer(num);
        }

        // Create a list to store the k largest elements
        List<Integer> result = new ArrayList<>();

        // Extract the k largest elements from the max heap
        for (int i = 0; i < k; i++) {
            result.add(maxHeap.poll());
        }

        // Sort the result list in ascending order
        Collections.sort(result);

        return result;
    }
}

