class Solution {
    public List<Integer> tri(int n) {
        List<Integer> tribonacci = new ArrayList<>();
        for (int i = 0; i <= n; i++) {
            tribonacci.add(calculateTribonacci(i));
        }
        return tribonacci;
    }

    private int calculateTribonacci(int n) {
        if (n == 0) return 1;
        if (n == 1) return 3;
        if (n % 2 == 0) {
            return 1 + n / 2;
        } else {
            return calculateTribonacci(n - 1) + calculateTribonacci(n - 2) + calculateTribonacci(n + 1);
        }
    }
}

