        Collections.sort(nums, (a, b) -> {
            int sumA = digitSum(a);
            int sumB = digitSum(b);
            if (sumA == sumB) {
                return Integer.compare(nums.indexOf(a), nums.indexOf(b));
            }
            return Integer.compare(sumA, sumB);
        });
        return nums;
