class Solution {
    public double poly(List<Double> xs, double x) {
        double result = 0;
        for (int i = 0; i < xs.size(); i++) {
            result += xs.get(i) * Math.pow(x, i);
        }
        return result;
    }

    public double find_zero(List<Double> xs) {
        double left = -1000; // Start with a large negative number
        double right = 1000; // Start with a large positive number
        double mid = 0;

        while (right - left > 1e-7) { // Precision threshold
            mid = (left + right) / 2;
            if (poly(xs, mid) > 0) {
                right = mid; // Move left
            } else {
                left = mid; // Move right
            }
        }
        return mid;
    }
}

