        List<Integer> primeFibs = new ArrayList<>();
        int a = 0, b = 1;

        while (primeFibs.size() < n) {
            int fib = a + b;
            a = b;
            b = fib;

            if (isPrime(fib)) {
                primeFibs.add(fib);
            }
        }

        return primeFibs.get(n - 1);
    }

    private boolean isPrime(int num) {
        if (num <= 1) return false;
        for (int i = 2; i * i <= num; i++) {
            if (num % i == 0) return false;
        }
        return true;
    }
}

