class Solution {
    public boolean triples_sum_to_zero(List<Integer> l) {
        int n = l.size();
        if (n < 3) return false;

        Collections.sort(l);
        for (int i = 0; i < n - 2; i++) {
            if (i > 0 && l.get(i).equals(l.get(i - 1))) continue; // Skip duplicates
            int left = i + 1;
            int right = n - 1;
            while (left < right) {
                int sum = l.get(i) + l.get(left) + l.get(right);
                if (sum == 0) {
                    return true;
                } else if (sum < 0) {
                    left++;
                } else {
                    right--;
                }
            }
        }
        return false;
    }
}

