class Solution {
    public boolean will_it_fly(List<Integer> q, int w) {
        int n = q.size();
        int sum = 0;
        boolean isBalanced = true;

        // Check if the list is a palindrome
        for (int i = 0; i < n / 2; i++) {
            if (!q.get(i).equals(q.get(n - 1 - i))) {
                isBalanced = false;
                break;
            }
        }

        // Calculate the sum of elements
        for (int num : q) {
            sum += num;
        }

        // Check the conditions for flying
        return isBalanced && sum <= w;
    }
}

