class Solution {
    public String anti_shuffle(String s) {
        String[] words = s.split("(?<=\\s)|(?=\\s)"); // Split while keeping spaces
        StringBuilder result = new StringBuilder();

        for (String word : words) {
            if (!word.trim().isEmpty()) { // If it's not just a space
                char[] chars = word.toCharArray();
                Arrays.sort(chars);
                result.append(new String(chars));
            } else {
                result.append(word); // Append the space as is
            }
        }

        return result.toString();
    }
}

