class Solution {
    public int count_nums(List<Integer> arr) {
        int count = 0;
        for (int num : arr) {
            if (sumOfDigits(num) > 0) {
                count++;
            }
        }
        return count;
    }

    private int sumOfDigits(int num) {
        int sum = 0;
        int absNum = Math.abs(num);
        while (absNum > 0) {
            sum += absNum % 10;
            absNum /= 10;
        }
        return num < 0 ? -sum : sum;
    }
}

