class Solution {
    public String exchange(List<Integer> lst1, List<Integer> lst2) {
        boolean hasEvenInLst2 = false;

        // Check if lst1 can be made all even
        for (int num : lst1) {
            if (num % 2 != 0) {
                // If lst1 has an odd number, check lst2 for even numbers
                hasEvenInLst2 = lst2.stream().anyMatch(n -> n % 2 == 0);
                if (!hasEvenInLst2) {
                    return "NO";
                }
            }
        }
        return "YES";
    }
}

