class Solution {
    public String intersection(List<Integer> interval1, List<Integer> interval2) {
        int start1 = interval1.get(0);
        int end1 = interval1.get(1);
        int start2 = interval2.get(0);
        int end2 = interval2.get(1);

        // Find the intersection
        int startIntersection = Math.max(start1, start2);
        int endIntersection = Math.min(end1, end2);

        // Calculate the length of the intersection
        if (startIntersection > endIntersection) {
            return "NO"; // No intersection
        }

        int length = endIntersection - startIntersection;

        // Check if the length is a prime number
        if (length < 2) {
            return "NO"; // Length is not prime
        }

        for (int i = 2; i <= Math.sqrt(length); i++) {
            if (length % i == 0) {
                return "NO"; // Length is not prime
            }
        }

        return "YES"; // Length is prime
    }
}

