        List<Integer> tribonacci = new ArrayList<>();
        for (int i = 0; i <= n; i++) {
            tribonacci.add(tribonacciHelper(i));
        }
        return tribonacci;
    }

    private int tribonacciHelper(int n) {
        if (n == 0) return 1;
        if (n == 1) return 3;
        if (n % 2 == 0) {
            return 1 + n / 2;
        } else {
            return tribonacciHelper(n - 1) + tribonacciHelper(n - 2) + tribonacciHelper(n + 1);
        }
    }
}

