import java.util.*;
import java.lang.*;

class Solution {
    public List<Integer> even_odd_count(int num) {
        int evenCount = 0;
        int oddCount = 0;
        num = Math.abs(num); // Consider absolute value for counting digits

        while (num > 0) {
            int digit = num % 10;
            if (digit % 2 == 0) {
                evenCount++;
            } else {
                oddCount++;
            }
            num /= 10;
        }

        List<Integer> result = new ArrayList<>();
        result.add(evenCount);
        result.add(oddCount);
        return result;
    }
}

