class Solution {
    public List<Integer> eat(int number, int need, int remaining) {
        int totalEaten = number;
        if (remaining >= need) {
            totalEaten += need;
            remaining -= need;
        } else {
            totalEaten += remaining;
            remaining = 0;
        }
        List<Integer> result = new ArrayList<>();
        result.add(totalEaten);
        result.add(remaining);
        return result;
    }
}

import java.util.*;
import java.lang.*;

class Solution {
    public int do_algebra(List<String> operator, List<Integer> operand) {
        int result = operand.get(0);
        for (int i = 0; i < operator.size(); i++) {
            String op = operator.get(i);
            int num = operand.get(i + 1);
            switch (op) {
                case "+":
                    result += num;
                    break;
                case "-":
                    result -= num;
                    break;
                case "*":
                    result *= num;
                    break;
                case "/":
                    result /= num;
                    break;
                case "**":
                    result = (int) Math.pow(result, num);
                    break;
            }
        }
        return result;
    }
}

import java.util.*;
import java.lang.*;

class Solution {
    public String solve(String s) {
        StringBuilder result = new StringBuilder();
        boolean hasLetter = false;

        // Check if there are any letters in the string
        for (char c : s.toCharArray()) {
            if (Character.isLetter(c)) {
                hasLetter = true;
                break;
            }
        }

        if (hasLetter) {
            // Reverse case for letters
            for (char c : s.toCharArray()) {
                if (Character.isLetter(c)) {
                    if (Character.isLowerCase(c)) {
                        result.append(Character.toUpperCase(c));
                    } else {
                        result.append(Character.toLowerCase(c));
                    }
                } else {
                    result.append(c);
                }
            }
        } else {
            // Reverse the string if no letters are present
            result.append(new StringBuilder(s).reverse());
        }

        return result.toString();
    }
}

import java.math.BigInteger;
import java.security.*;
import java.util.*;
import java.lang.*;

class Solution {
    public Optional<String> string_to_md5(String text) throws NoSuchAlgorithmException {
        if (text.isEmpty()) {
            return Optional.empty();
        }

        MessageDigest md = MessageDigest.getInstance("MD5");
        md.update(text.getBytes());
        byte[] digest = md.digest();

        String hash = String.format("%032x", new BigInteger(1, digest));
        return Optional.of(hash);
    }
}

import java.util.*;
